static const float lerpChanel(unsigned char* chanelData, float devX, float devY) {
	return (1.f - devX) * (chanelData[0] * (1.f - devY) + chanelData[2] * devY) + devX * (chanelData[1] * (1.f - devY) + chanelData[3] * devY);
}

static unsigned char* createPixelData(int w, int h) {
	// Create memory for RGBA pixels
	unsigned char* dataArray = new unsigned char[w*h * 4];
	float actualY, actualX, devFactorX, devFactorY;
	int basePixel, baseY, baseX;
	int baseOrigin[4];
	float lerpPixel[4];
	unsigned char vals[4];
	for (int y = 0; y < h; y++) { // for each line of pixels
		actualY = ((float)y) / h * 96; // y linear interpolation
		for (int x = 0; x < w; x++) { // for each pixel in this line
			actualX = ((float)x) / w * 96; // x linear interpolation
			basePixel = 4*(y*w + x); // index of the pixel
			baseX = (int)std::floor(actualX);
			baseY = (int)std::floor(actualY);
			devFactorX = actualX - baseX;
			devFactorY = actualY - baseY;
			baseOrigin[0] = baseY * 96 + baseX;
			baseOrigin[1] = (baseX < 95) ? baseOrigin[0] + 1 : baseOrigin[0];
			baseOrigin[2] = (baseY < 95) ? baseOrigin[0] + 96 : baseOrigin[0];
			baseOrigin[3] = ((baseX < 95) && (baseY < 95)) ? baseOrigin[1] + 96 : baseOrigin[0];

			for (int i = 0; i < 3; i++) { // R, G, B
				for (int m = 0; m < 4; m++) { // four adjacent pixels
					vals[m] = simulatorIconData_rgb[baseOrigin[m] * 3 + i];
				}
				lerpPixel[i] = lerpChanel(vals, devFactorX, devFactorY);
			}
			for (int m = 0; m < 4; m++) { // four adjacent pixels
				vals[m] = simulatorIconData_alpha[baseOrigin[m]];
			}
			lerpPixel[3] = lerpChanel(vals, devFactorX, devFactorY) * 255.f / 63.f; // alpha fix for formatting

			dataArray[basePixel] = (unsigned char)roundf(lerpPixel[0]); // red
			dataArray[basePixel + 1] = (unsigned char)roundf(lerpPixel[1]); // green
			dataArray[basePixel + 2] = (unsigned char)roundf(lerpPixel[2]); // blue
			dataArray[basePixel + 3] = (unsigned char)roundf(lerpPixel[3]); // alpha
		}
	}
	return dataArray;
}